        () => {
            callback
        },
        []);

    return (
        <Card
            actions={[
                <div key="twit">짹짹</div>,
                <div key="followings">팔로잉</div>,
                <div key="followings">팔로워</div>,
            ]}
        >
            <Card.Meta 
                avatar={<Avatar>ZC</Avatar>}
                title="ZeroCho"
            />
            <Button>로그아웃</Button>
        </Card>
    )
}

export default UserProfile;
